$(document).on('click', '#btnImprimir', function (event) {
    //event.preventDefault();

    $.ajaxSetup({
        headers: {
            'X-CSRF-TOKEN': jQuery('meta[name="csrf-token"]').attr('content')
        }
    });

    var imagen = 'data:image/png;base64,';
    //var imagen ='data:image/png;base64,'+btoa('fge.png');
    var idSol = $('#idSol').val();
    $.ajax({
        url: window.location.origin+'/solicitudes/generar',
        type: 'POST',
        data: { idSol },
        dataType: 'json',
        success: function (response) {
            var solicitud = response.solicitud;
            var empleado = response.empleado;
            var tipoSol = response.tipoSolicitud;
            var area = response.area;
            var tipoSer = response.tipoSer;
            var equipo = response.equipo;
            var computadora = response.computadora;
            var tipoRep = response.tipoRep;
            var soporte = response.soporte;

            var doc = new jsPDF();

            doc.addImage(imagen,'PNG',15,10,25,25);

            doc.setFont('times','bold');
            doc.setFontSize(10);
            doc.text('DIRECCIÓN GENERAL DE TECNOLOGÍAS DE LA INFORMACIÓN',50,20);
            doc.text('ÁREA DE SOPORTE TÉCNICO',50,25);
            doc.text('FORMATO: DGTI-DTV-1.1',50,30);

            var etiqueta = {fillColor: [39, 61, 114], textColor: [255, 255, 255], fontStyle: 'bold'}
            var etiquetaL = {fillColor: [39, 61, 114], textColor: [255, 255, 255],  fontStyle: 'bold', halign: 'center',valign:'middle'}
            doc.autoTable({
                theme: 'grid',
                startY:40,
                styles: {font: 'times',fontSize: 10,  fontStyle: 'bold'},
                body: [
                    [{ content: 'Folio', styles: etiqueta}, solicitud.folio,
                        { content: 'Fecha de solicitud', styles: etiqueta},solicitud.fechaRegistro],
                    [{ content: 'Oficio Relacionado', styles: etiqueta}, solicitud.oficioRelacionado,
                        { content: 'Tipo solicitud', styles: etiqueta},tipoSol.tipoSolicitud],
                    //Datos del solicitante
                    [{content: 'DATOS SOLICITANTE',styles: etiquetaL, colSpan: 4}],
                    [{ content: 'Nombre', styles: etiqueta}, empleado.nombre+' '+empleado.apellidoPat+' '+empleado.apellidoMat,
                        { content: 'Teléfono', styles: etiqueta},empleado.telefonoPersonal],
                    [{ content: 'E-mail', styles: etiqueta}, empleado.email,
                        { content: 'Servicio solicitado', styles: etiqueta},tipoSer.tipoServicio],
                    [{ content: 'Área', styles: etiqueta}, {content: area.area, colSpan: 3},],
                    [{content: 'DESCRIPCIÓN BREVE DE LA FALLA', colSpan: 4, styles: etiquetaL}],
                    [{content: solicitud.descripcionFalla, colSpan: 4}],
                    //Datos del equipo
                    [{content: 'DATOS DEL EQUIPO', colSpan: 4, styles: etiquetaL}],
                    [{ content: 'Marca', styles: etiqueta}, equipo.marca,
                        { content: 'Modelo', styles: etiqueta},equipo.modelo],
                    [{ content: 'No. serie', styles: etiqueta}, equipo.numeroSerie,
                        { content: 'Clave inventarial', styles: etiqueta},equipo.claveInventarial],
                    [{content: 'Nombre del equipo',styles: etiqueta},{content: computadora!=null ? computadora.nombre_computadora:''},
                        {content: 'Grupo de trabajo', styles: etiqueta},{content: computadora!=null ? computadora.grupo_de_trabajo:''}],
                    [{content: 'ESPECIFICACIONES TÉCNICAS', colSpan: 4, styles: etiquetaL}],
                    [{ content: 'Disco duro', styles: etiqueta}, computadora!=null ? computadora.discoDuro:'',
                        { content: 'Sistema operativo', styles: etiqueta},computadora!=null?computadora.sistemaOperativo:''],
                    [{ content: 'RAM', styles: etiqueta}, computadora!=null ? computadora.ram:'',
                        { content: 'Procesador', styles: etiqueta},computadora!=null?computadora.procesador:''],
                    [{content: 'Observaciones',styles: etiqueta}, {content: solicitud.observaciones, colSpan:3}],
                    [{content: 'Tipo de reparación',colSpan: 2,styles: etiquetaL},{content: tipoRep.tipoReparacion,colSpan: 2}],
                    [{content: 'Autorización de salida del equipo\n(Nombre y firma del responsable del equipo)',colSpan:2, styles: etiquetaL},
                        {content: '\n\n\n',colSpan: 2}],
                    //Datos del equipo
                    [{content: 'DATOS DEL SOPORTE',colSpan: 4,styles: etiquetaL}],
                    [{content: 'Empleado de soporte',styles: etiqueta},{content: soporte.nombre+' '+soporte.apellidoPat+' '+soporte.apellidoMat,colSpan: 3}],
                    [{content: 'Diagnóstico del equipo',styles:etiqueta},{content: solicitud.diagnostico,colSpan:3}],
                    [{content: 'Carpeta respaldada', styles: etiqueta},{content: solicitud.respaldo,colSpan:3}],
                    //Dato de entrega del equipo
                    [{content: 'DATOS DE ENTREGA DEL EQUIPO (para llenar por el responsable del equipo)',colSpan: 4,styles: etiquetaL}],
                    [{content: 'El equipo fue reparado\n( )Si ( )No',colSpan:2,styles: {halign:'center'}},
                        {content: 'El equipo se instaló en su ubicación respectiva\n( )Si ( )No',colSpan:2,styles: {halign:'center'}}],
                    [{content: 'Fecha de entrega:\n',colSpan:2},{content: 'Firma de conformidad:',colSpan:2}],
                    [{content: 'Calificación del servicio: ( )Excelente  ( )Bueno  ( )Malo',colSpan:4}],
                ],
            });

            doc.save('solicitud.pdf');
        },
        error: function (response) {
            console.log(response);
        }
    });

});